void draw_ascii(const char *str, int x, int y) {
    char dest[180][320];
    for (int i = 0; i < 320; i++) {
        for (int j = 0; j < 180; j++) {
            dest[j][i] = str[i * 180 + j];
        }
    }
    for (int j = y; j < (y + 180); j++) {
        for (int i = x; i < (x + 320); i++) {
            char ch = dest[j - y][i - x];
            if (ch == 'b') {
                gl_draw_pixel(i, j, b);
            }
            else if (ch == 'c') {
                gl_draw_pixel(i, j, c);
            }
            else if (ch == 'd') {
                gl_draw_pixel(i, j, d);
            } 
            else if (ch == 'e') {
                gl_draw_pixel(i, j, e);
            }
            else if (ch == 'f') {
                gl_draw_pixel(i, j, f);
            }
        }
    }
}

